import React, { useEffect, useState } from 'react';
import axios from 'axios';

function PostsPage() {
    const [posts, setPosts] = useState([]);

    useEffect(() => {
        const fetchPosts = async () => {
            try {
                const res = await axios.get('/api/posts');
                setPosts(res.data);
            } catch (err) {
                console.error(err);
            }
        };

        fetchPosts();
    }, []);

    return (
        <div>
            <h1>Community Posts</h1>
            <ul>
                {posts.map(post => (
                    <li key={post.PostID}>
                        <p>{post.Content}</p>
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default PostsPage;
